;&#13;&#10;  &lt;td class=xl15&gt;ankle weights&lt;/td&gt;&#13;&#10;  &lt;td colspan=2 class=xl15 style='mso-ignore:colspan'&gt;&lt;/td&gt;&#13;&#10; &lt;/tr&gt;&#13;&#10; &lt;tr height=68 style='height:51.0pt'&gt;&#13;&#10;  &lt;td class=xl15 x:num=&quot;166&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl26 width=175 style='width:131pt'&gt;7 Tree Island&lt;/td&gt;&#13;&#10;  &lt;td class=xl39 x:num=&quot;36643&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15 x:num=&quot;65&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15 style='mso-ignore:style;color:green' x:num=&quot;1&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15 style='mso-ignore:style;color:green' x:num=&quot;38&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl24 x:num=&quot;2850&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl24 x:num=&quot;600&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl24 x:num=&quot;2250&quot; x:fmla=&quot;=G172-H172&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 x:num=&quot;59.210526315789473&quot; x:fmla=&quot;=I172/F172&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl26 width=1586 style='width:1190pt'&gt;Great flight out to Port Hardy&#13;&#10;  w/Todd in his plane yesterday.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Then&#13;&#10;  we caught a charter Bell Ranger III charter from Vancouver Island Helicopter&#13;&#10;  (VIH) LTD (604.656.3987) out to the cabin.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp;&#13;&#10;  &lt;/span&gt;Landed on a tiny helipad along the shoreline w/lots of trees quite&#13;&#10;  close by-- some impressive maneuvering with the wind that was kicking&#13;&#10;  up.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;This morning it's calm, after the&#13;&#10;  evening storm in the cabin.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Great&#13;&#10;  hearty breakfast of pancakes, eggs &amp;amp; coffee made by Mike and Jack.&lt;span&#13;&#10;  style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Randy, Barry, Todd &amp;amp; I motor out to&#13;&#10;  the dive site in a 25' x 7' aluminum weld skiff 'The Herring Punt' with a&#13;&#10;  Yamaha 25hp @ ~10:50 either for 7 Tree Island, Buttertart or Ruth's reef site&#13;&#10;  depending on conditions when we're out there.&lt;span style=&quot;mso-spacerun:&#13;&#10;  yes&quot;&gt;&nbsp; &lt;/span&gt;Feels warm (air).&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;I&#13;&#10;  guessed 65deg in all this gear but Todd says it's ~50deg.&lt;span&#13;&#10;  style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;With my yellow shades it could be 85deg&#13;&#10;  and balmy!&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Boat cruises at 10mph.__I&#13;&#10;  have 19lbs total which is 17 on my belt and 2 in my pocket; no ankle weights.&#13;&#10;  I've got the 2 steel 72s I got from Bud at Bubbles Below.&lt;span&#13;&#10;  style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;I'm trying my newly (homemade) split&#13;&#10;  fins-- turns out they worked great.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;I&#13;&#10;  was nice and warm in my new suit... didn't even think about the cold.&lt;span&#13;&#10;  style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;We're essentially on Browning Passage in a&#13;&#10;  nearrow section between 7 tree Island and Balaklava Island (not the more open&#13;&#10;  section across to Nigei I.)&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Lots of&#13;&#10;  fish, sea cucumbers colorful purple anemones, sea urchin and pink soft coral&#13;&#10;  relative to my previous NW diving experience.&lt;/td&gt;&#13;&#10;  &lt;td height=68 class=xl15 style='height:51.0pt'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15&gt;Todd Roberts&lt;/td&gt;&#13;&#10;  &lt;td colspan=4 class=xl15 style='mso-ignore:colspan'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15&gt;dry suit, hood, gloves&lt;/td&gt;&#13;&#10;  &lt;td class=xl15 x:num=&quot;19&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15 x:num=&quot;35&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15&gt;Balaklava I., BC&lt;/td&gt;&#13;&#10;  &lt;td colspan=2 class=xl15 style='mso-ignore:colspan'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15&gt;Salt&lt;/td&gt;&#13;&#10;  &lt;td class=xl31 x:num=&quot;0.47916666666666669&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl31 style='border-left:none' x:num=&quot;0.51388888888888895&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl26 width=191 style='width:143pt'&gt;Balaklava Dry Suit Shakedown&#13;&#10;  Trip&lt;/td&gt;&#13;&#10;  &lt;td class=xl26 width=126 style='width:95pt'&gt;Light&lt;/td&gt;&#13;&#10;  &lt;td colspan=2 class=xl15 style='mso-ignore:colspan'&gt;&lt;/td&gt;&#13;&#10; &lt;/tr&gt;&#13;&#10; &lt;tr height=68 style='height:51.0pt'&gt;&#13;&#10;  &lt;td class=xl15 x:num=&quot;167&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl26 width=175 style='width:131pt'&gt;NW end of Hurst I. (near God's&#13;&#10;  Pocket)&lt;/td&gt;&#13;&#10;  &lt;td class=xl39 x:num=&quot;36643&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15 x:num=&quot;70&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15 style='mso-ignore:style;color:red' x:num=&quot;0&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15 style='mso-ignore:style;color:green' x:num=&quot;32&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl24 x:num=&quot;2750&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl24 x:num=&quot;750&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15 x:num=&quot;2000&quot; x:fmla=&quot;=G173-H173&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl35 style='border-top:none' x:num=&quot;62.5&quot; x:fmla=&quot;=I173/F173&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl26 width=1586 style='width:1190pt'&gt;Tonight we're at NW Hurst&#13;&#10;  it's a site around from God's Pocket Resort at the NW end of Hurst Island&#13;&#10;  facing Mike's cabin on Balaklava across Christie Pass. We drop in and swim&#13;&#10;  South along the wall.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;I added 2x2lb&#13;&#10;  ankle weights, but didn't have the 2lbs in my pockent for a total of 21lbs,&#13;&#10;  and I used Barry's aluminum 80.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;I was&#13;&#10;  positive the whole time and looking for rocks to hold.&lt;span&#13;&#10;  style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Troubling.&lt;span style=&quot;mso-spacerun:&#13;&#10;  yes&quot;&gt;&nbsp; &lt;/span&gt;Basically uncontrolled ascent from 40' (let alone blowing my&#13;&#10;  safety stop).&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Not feet first but&#13;&#10;  after getting tired after ~30min, with ascent and air expansion I just couldn't&#13;&#10;  stay down.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Knew it was going to&#13;&#10;  happen... not pleasant.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;The site&#13;&#10;  itself was beautiful.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Lots of life.&lt;span&#13;&#10;  style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Neutibranchs on EVERY rock I went to&#13;&#10;  pickup (so I left them)!&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;More sea&#13;&#10;  cukes, organge coral pollups.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;White&#13;&#10;  polyops opening and darting in with my passing by.&lt;span style=&quot;mso-spacerun:&#13;&#10;  yes&quot;&gt;&nbsp; &lt;/span&gt;Talked with a God's Pocket boat that had several divers from&#13;&#10;  Sweden aboard; Randy knows the resort guys.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp;&#13;&#10;  &lt;/span&gt;Guess when you're the only ones in the middle of nowhere, you know&#13;&#10;  your 'neighbors'.&lt;/td&gt;&#13;&#10;  &lt;td height=68 class=xl15 style='height:51.0pt'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15&gt;Todd Roberts&lt;/td&gt;&#13;&#10;  &lt;td colspan=4 class=xl15 style='mso-ignore:colspan'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15&gt;dry suit, hood, gloves&lt;/td&gt;&#13;&#10;  &lt;td class=xl15 x:num=&quot;21&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15 x:num=&quot;60&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15&gt;Balaklava I., BC&lt;/td&gt;&#13;&#10;  &lt;td colspan=2 class=xl15 style='mso-ignore:colspan'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15&gt;Salt&lt;/td&gt;&#13;&#10;  &lt;td class=xl25 x:num=&quot;0.71180555555555547&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl25&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl26 width=191 style='width:143pt'&gt;Balaklava Dry Suit Shakedown&#13;&#10;  Trip&lt;/td&gt;&#13;&#10;  &lt;td class=xl26 width=126 style='width:95pt'&gt;ankle weights&lt;/td&gt;&#13;&#10;  &lt;td colspan=2 class=xl15 style='mso-ignore:colspan'&gt;&lt;/td&gt;&#13;&#10; &lt;/tr&gt;&#13;&#10; &lt;tr height=68 style='height:51.0pt'&gt;&#13;&#10;  &lt;td class=xl15 x:num=&quot;168&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl26 width=175 style='width:131pt'&gt;Mike's Mooring&lt;/td&gt;&#13;&#10;  &lt;td class=xl39 x:num=&quot;36644&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15 x:num=&quot;30&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15 style='mso-ignore:style;color:green' x:num=&quot;3&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15 style='mso-ignore:style;color:green' x:num=&quot;32&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl24 x:num=&quot;2900&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl24 x:num=&quot;1900&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl24 x:num=&quot;1000&quot; x:fmla=&quot;=G174-H174&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15 x:num=&quot;31.25&quot; x:fmla=&quot;=I174/F174&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl26 width=1586 style='width:1190pt'&gt;28lbs this time including 4&#13;&#10;  lbs of ankle weights-- I used 1 less sweatshirt &amp;amp; was exceedingly careful&#13;&#10;  about adding air air. Wore long johns top/bottom, and fleece pants, and 1&#13;&#10;  fleece vest &amp;amp; 1 fleece sweatshirt up top (didn't wear the 2nd fleece sweatshirt&#13;&#10;  up top like last 2 dives).&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;This dive&#13;&#10;  was very shallow at times, and I could stay down-- at the time I was thinking&#13;&#10;  w/2 extra lbs (or an even 30lbs) I'd be most confident... and over&#13;&#10;  time/experience w/the suit could start shedding some weight.__ We searched&#13;&#10;  for the missing mooring and found the mooring anchor &amp;amp; chain but the ball&#13;&#10;  was gone (not wrapped around the kelp like they were anticipating).&lt;span&#13;&#10;  style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Lots of sea urchin, big sea cucumbers, a&#13;&#10;  crab.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;A couple nice sized purple&#13;&#10;  spotted fish (~14-16&amp;quot; Kelp Greenling).&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp;&#13;&#10;  &lt;/span&gt;My first time in the kelp beds... very nice, &amp;amp; lively bottom.&lt;span&#13;&#10;  style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Neat effect with the sun shining through&#13;&#10;  at an angle.__ Earlier in the day, we had some great homemade beer w/Alan&#13;&#10;  &amp;amp; Darlene Tansky (GoletasGirl@Sprint.Ca) the lighthouse keeper after&#13;&#10;  scrubbing down the 'GreenBob'; Mike's fiberglass runabout.&lt;span&#13;&#10;  style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Personally, I really like the&#13;&#10;  &amp;quot;Punt&amp;quot; which was made in Delta, BC.&lt;span style=&quot;mso-spacerun:&#13;&#10;  yes&quot;&gt;&nbsp; &lt;/span&gt;Then we forged a trail back through the Salal (scrub brush).&#13;&#10;  Some sections of the hike were easier through the old (massive) growth.&lt;span&#13;&#10;  style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;After that long day we enjoyed dinner&#13;&#10;  w/some fantastic home baked bread which Darlene had given us to take to share&#13;&#10;  with Mike.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Wow was that good.&lt;/td&gt;&#13;&#10;  &lt;td height=68 class=xl15 style='height:51.0pt'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15&gt;Randy Shuman&lt;/td&gt;&#13;&#10;  &lt;td colspan=4 class=xl15 style='mso-ignore:colspan'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15&gt;dry suit, hood, gloves&lt;/td&gt;&#13;&#10;  &lt;td class=xl15 x:num=&quot;28&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15 x:num=&quot;60&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15&gt;Balaklava I., BC&lt;/td&gt;&#13;&#10;  &lt;td colspan=2 class=xl15 style='mso-ignore:colspan'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15&gt;Salt&lt;/td&gt;&#13;&#10;  &lt;td class=xl25 x:num=&quot;0.75&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl25&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl26 width=191 style='width:143pt'&gt;Balaklava Dry Suit Shakedown&#13;&#10;  Trip&lt;/td&gt;&#13;&#10;  &lt;td class=xl26 width=126 style='width:95pt'&gt;ankle weights&lt;/td&gt;&#13;&#10;  &lt;td colspan=2 class=xl15 style='mso-ignore:colspan'&gt;&lt;/td&gt;&#13;&#10; &lt;/tr&gt;&#13;&#10; &lt;tr height=68 style='height:51.0pt'&gt;&#13;&#10;  &lt;td class=xl15 x:num=&quot;169&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl26 width=175 style='width:131pt'&gt;Browning Wall&lt;/td&gt;&#13;&#10;  &lt;td class=xl39 x:num=&quot;36645&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15 x:num=&quot;70&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15 style='mso-ignore:style;color:green' x:num=&quot;1&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15 style='mso-ignore:style;color:green' x:num=&quot;35&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl24 x:num=&quot;2800&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl24 x:num=&quot;800&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15 x:num=&quot;2000&quot; x:fmla=&quot;=G175-H175&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 x:num=&quot;57.142857142857146&quot; x:fmla=&quot;=I175/F175&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl26 width=1586 style='width:1190pt'&gt;I think ideal is 28lbs, or&#13;&#10;  perhaps 30 if I wear the 2nd seatshirt over my vest and long johns.&lt;span&#13;&#10;  style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Very nice wall dive with schooling fish,&#13;&#10;  china rockfish, puget sound king crab and lots of white anemones.&lt;span&#13;&#10;  style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Kelp was growing from 40' on up.&lt;span&#13;&#10;  style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;We were out and on our lunch spot along&#13;&#10;  Nigei Island at ~1:15p-- I took a picture there and marked the spot on the&#13;&#10;  GPS as 'Negei'.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;After the dive, we&#13;&#10;  spent some time at God's Pocket resort.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp;&#13;&#10;  &lt;/span&gt;We spoke with Bill who seemed tgo be running the place, and had some&#13;&#10;  coffee.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Nice, basic setup.&lt;span&#13;&#10;  style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;The group of Swedes were largely from&#13;&#10;  Gotenberg.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;They had some SERIOUS&#13;&#10;  photo equipment.__ The following day there was a serious storm... and the helicopter&#13;&#10;  wouldn't/couldn't fly in to meet up.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp;&#13;&#10;  &lt;/span&gt;We waited out most of the day, and toward the evening things were&#13;&#10;  calming down a little bit... and we had a boat meet us out in a small harbor&#13;&#10;  area where they tie off the herring punt.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp;&#13;&#10;  &lt;/span&gt;We made the trip back in this bigger alum weld boat and checked into&#13;&#10;  the Quarterdeck Inn &amp;amp; Marina where we had several beers and dinner and&#13;&#10;  most importantly the first real show in several days.&lt;span&#13;&#10;  style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;This was really a fantastic trip.&lt;span&#13;&#10;  style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Great getting back to basics for a bit,&#13;&#10;  and leaving the hustle/bustle behind.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp;&#13;&#10;  &lt;/span&gt;Mike had a picture from Winnie the Pooh watching Christopher Robin put&#13;&#10;  on his 'big boots' up in the cabin w/the caption that explains when you see a&#13;&#10;  friend putting on his big boots you know you're in for an adventure.&lt;span&#13;&#10;  style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;That sums it up pretty well... it was&#13;&#10;  definitely a big boot excursion.&lt;/td&gt;&#13;&#10;  &lt;td height=68 class=xl15 style='height:51.0pt'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15&gt;Todd Roberts&lt;/td&gt;&#13;&#10;  &lt;td colspan=4 class=xl15 style='mso-ignore:colspan'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15&gt;dry suit, hood, gloves&lt;/td&gt;&#13;&#10;  &lt;td class=xl15 x:num=&quot;30&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td colspan=2 class=xl15 style='mso-ignore:colspan'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15&gt;Balaklava I., BC&lt;/td&gt;&#13;&#10;  &lt;td colspan=2 class=xl15 style='mso-ignore:colspan'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl15&gt;Salt&lt;/td&gt;&#13;&#10;  &lt;td class=xl25&gt;noon&lt;/td&gt;&#13;&#10;  &lt;td class=xl25&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl26 width=191 style='width:143pt'&gt;Balaklava Dry Suit Shakedown&#13;&#10;  Trip&lt;/td&gt;&#13;&#10;  &lt;td class=xl26 width=126 style='width:95pt'&gt;ankle weights&lt;/td& ;&#13;&#10;  &lt;/span&gt;I suspect the 2 electrodes effectively were joined by the full&#13;&#10;  submersion.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Oh well.&lt;span&#13;&#10;  style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Maybe I'll try the Polar at some point.&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;Craig Rees&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;NAUI&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none' x:num=&quot;74&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;full suit (1pc),&#13;&#10;  booties, hooded vest&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none' x:num=&quot;23&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;Seattle Aquarium&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;Salt, Shallow&lt;/td&gt;&#13;&#10;  &lt;td class=xl31 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl31 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl30 width=191 style='border-top:none;border-left:none;width:143pt'&gt;feed&#13;&#10;  'n clean tank&lt;/td&gt;&#13;&#10;  &lt;td class=xl30 width=126 style='border-t uot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;HR monitor definitely does not work under&#13;&#10;  water; not a transmission problem, but a conductivity problem as the&#13;&#10;  electrodes become one.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Upon the&#13;&#10;  descent we went through a swim through and came out in a spot with numerous&#13;&#10;  black coral 'trees'.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;A curious 2.5'&#13;&#10;  baracuda swam with us for most of the dive.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp;&#13;&#10;  &lt;/span&gt;At depth, we saw a turtle below us at ~110'; a small one, probably&#13;&#10;  about 1-1.5' at shell's longest point.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp;&#13;&#10;  &lt;/span&gt;A good first dive w/Dave who ran the boat and Jason who dove w/us&#13;&#10;  today... no sinus problems on the descent.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp;&#13;&#10;  &lt;/span&gt;Trina was comfortable... in at 3400psi, out at 1200psi; used 14lbs&#13;&#10;  (had 12 initially then added 2 which Jason our DM was on top of).&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;Trina Seinfeld&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;NAUI&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;shorty, booties&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none' x:num=&quot;10&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;good&lt;/td&gt;&#13;&#10;  & ='border-top:none;border-left:none' x:num=&quot;1500&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none' x:num=&quot;1700&quot;&#13;&#10;  x:fmla=&quot;=G195-H195&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&#13;&#10;  x:num=&quot;40.476190476190474&quot; x:fmla=&quot;=I195/F195&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl30 width=1586 style='border-top:none;border-left:none;width:1190pt'&gt;Another&#13;&#10;  good dive comfortable came out at 96bpm.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp;&#13;&#10;  &lt;/span&gt;Trina explained the sign language for 'I love you' while we were&#13;&#10;  underwater.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Trina was definitely the&#13;&#10;  eyes for this dive-- she spotted a turtle.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp;&#13;&#10;  &lt;/span&gt;This one was a little bigger-- close to 2' though still on the small&#13;&#10;  side.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;It was sitting on the reef at&#13;&#10;  60'.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Our descent put us down near&#13;&#10;  some large ~5-6' pillar coral. Trina also spotted a great Trunkfish; I love&#13;&#10;  those.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Saw two beautiful French&#13;&#10;  Angelfish (~14+&amp;quot; discs). I did have some troubles w/my left sinus&#13;&#10;  passage-- was able to clear it over time but did notice it, unlike the first&#13;&#10;  dive.&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;Trina Seinfeld&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;NAUI&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt; &#13;&#10;  down and opened up at depth onto the wall.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp;&#13;&#10;  &lt;/span&gt;To our right (east) there were some black coral trees. We went west&#13;&#10;  along the wall and spotted a hammerhead shark (maybe ~5ft) checking us out&#13;&#10;  before he swam off into the blue.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp;&#13;&#10;  &lt;/span&gt;Trina also spotted me a puffer for valentine's day-- not sure if it&#13;&#10;  was a Porcupinefish or a Ballonfish.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp;&#13;&#10;  &lt;/span&gt;It was easily 1.5'.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Nice&#13;&#10;  little guy... longer than my little buddy at the aquarium who used to bop me&#13;&#10;  in the head from behind when I got in.&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;Trina Seinfeld&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;NAUI&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;shorty, booties&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none' x:num=&quot;8&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;good&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none' x:num=&quot;60&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;Grand Cayman&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;N19 21.522&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style= lt;span&#13;&#10;  style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Came across a beautiful yellow, marbled&#13;&#10;  ~2&amp;quot; nudibranch on a sea fan.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp;&#13;&#10;  &lt;/span&gt;Killed all the lights and waved our arms around lighting up the&#13;&#10;  bioluminescence.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Got the blookworms&#13;&#10;  attracted to my light, and then brought them over to a pink tipped anemone&#13;&#10;  and watched it gorge on them and pull in all its tenticles into a big lip&#13;&#10;  around it's circumference.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Also swam&#13;&#10;  up to a big 8' steel anchor from some old wreck (wreck wasn't around...&#13;&#10;  someone had pulled it to there on the way back to their back beach before&#13;&#10;  conservation stopped them in their tracks).&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp;&#13;&#10;  &lt;/span&gt;In general a really nice evening.&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;Trina Seinfeld&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;NAUI&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;shorty w/1mm scubapro&#13;&#10;  titanium vest undernea&lt;span style='display:none'&gt;th, booties&lt;/span&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none' x:num=&quot;10&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;Grand Cayman&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;N19 18.348&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;W81 04.946&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;Salt, Boat&lt;/td&gt;&#13;&#10;  &lt;td class=xl31 style='border-top:none;border-left:none'&#13;&#10;  x:num=&quot;0.77083333333333337&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl31 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl30 width=191 style='border-top:none;border-left:none;width:143pt'&gt;night&#13;&#10;  (reef) dive&lt;/td&gt;&#13;&#10;  &lt;td class=xl30 width=126 style='border-top:none;border-left:none;width:95pt'&gt;light&#13;&#10;  &amp;amp; headlamp&lt;/td&gt;&#13;&#10;  &lt;td height=85 class=xl15 style='height:63.75pt'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none'&gt;&lt;/td&gt;&#13;&#10; &lt;/tr&gt;&#13;&#10; &lt;tr height=85 style='height:63.75pt'&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none' x:num=&quot;195&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl30 width=175 style='border-top:none;border-left:none;width:131pt'&gt;Shark&#13;&#10;  Alley&lt;/td&gt;&#13;&#10;  &lt;td class=xl38 style='border-top:none;border-left:none' x:num=&quot;36939&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none' x:num=&quot;55&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none none;mso-ignore:style;color:green'&#13;&#10;  x:num=&quot;1&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none' x:num=&quot;42&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none' x:num=&quot;3250&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none' x:num=&quot;1750&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none' x:num=&quot;1500&quot;&#13;&#10;  x:fmla=&quot;=G201-H201&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&#13;&#10;  x:num=&quot;35.714285714285715&quot; x:fmla=&quot;=I201/F201&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl30 width=1586 style='border-top:none;border-left:none;width:1190pt'&gt;Mark,&#13;&#10;  Collin dove w/us and Dave ran the Nauticat.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp;&#13;&#10;  &lt;/span&gt;Planned profile was 55' for 40min.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp;&#13;&#10;  &lt;/span&gt;I didn't wear the heart rate monitor-- figured just in case it was&#13;&#10;  transmitting electrical pulse, that might not be the best thing to have the&#13;&#10;  sharks listening to particularly if I got excited. (Particularly after just&#13;&#10;  learning that at 6' they can detect 1 hundred millionth of a volt from a&#13;&#10;  wound). We did a class room session first which was actually really well&#13;&#10;  done.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Some slides, w/various videos&#13;&#10;  interspersed, including a bit of the Discovery Channel's 'Ultimate guide to&#13;&#10;  sharks'.&lt;br&gt;&#13;&#10;  Really well done dive.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Upon&#13;&#10;  descent you could see down onto the sandy bottom site-- and a few sharks were&#13;&#10;  already swimming around in the area.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp;&#13;&#10;  &lt;/span&gt;We all took spots on the bottom w/our backs to a 5' coral head, and&#13;&#10;  the sharks were swimming around the group quite calmly, along with a big&#13;&#10;  school of snapper, and yellow tailed jacks.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp;&#13;&#10;  &lt;/span&gt;Trina and I were center stage-- about 30' from the bucket w/the food&#13;&#10;  in it.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;I counted 7 of the Caribean&#13;&#10;  reef sharks at any one time (after the dive when we went through all the&#13;&#10;  sharks/markings, Mark clarified that there were 9 different ones that were&#13;&#10;  visiting with us between 4-6'). They pulled the lid, and for a few minutes&#13;&#10;  the sharks fed-- activity picked up significantly.&lt;span style=&quot;mso-spacerun:&#13;&#10;  yes&quot;&gt;&nbsp; &lt;/span&gt;Understandably so, Trina found it a bit unsettling-- really&#13;&#10;  grabbed my arm!&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;I kept an eye on her&#13;&#10;  air, and massaged her shoulders. Between all the commotion and the surge&#13;&#10;  pushing us back and forth, she had enough.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp;&#13;&#10;  &lt;/span&gt;So after things settled down a bit, I surfaced w/her (about 25min into&#13;&#10;  the dive) and she got back on the boat.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp;&#13;&#10;  &lt;/span&gt;After ensuring she was ok, I dropped back in to the site.&lt;span&#13;&#10;  style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Very cool heading back down, and really&#13;&#10;  swimming freely with them beyond the controlled site 'stage' where we kneeled&#13;&#10;  during the feeding.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;What struck me&#13;&#10;  was how long the sharks hung around and swam with us after the feeding.&lt;span&#13;&#10;  style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Basically, several of them stayed until we&#13;&#10;  left-- I swam quite closely (a couple feet) from a few of them. They're&#13;&#10;  definitely graceful creatures swimming quite fluidly and effortlessly as they&#13;&#10;  push off/against the water with their torso/tail.&lt;span style=&quot;mso-spacerun:&#13;&#10;  yes&quot;&gt;&nbsp; &lt;/span&gt;3 of them had fishing leaders trailer out of their mouths.&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;Trina Seinfeld&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;NAUI&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;shorty, booties&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none' x:num=&quot;10&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;good&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none' x:num=&quot;70&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;Grand Cayman&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;N19 17.657&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;W81 05.602&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;Salt, Boat, Surge&#13;&#10;  (most n&lt;span style='display:none'&gt;oticable while kneeling on the sandy&#13;&#10;  bottom)&lt;/span&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl31 style='border-top:none;border-left:none'&#13;&#10;  x:num=&quot;0.63888888888888895&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl31 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl30 width=191 style='border-top:none;border-left:none;width:143pt'&gt;shark&#13;&#10;  awareness&lt;/td&gt;&#13;&#10;  &lt;td class=xl30 width=126 style='border-top:none;border-left:none;width:95pt'&gt;&lt;/td&gt;&#13;&#10;  &lt;td height=85 class=xl15 style='height:63.75pt'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none'&gt;&lt;/td&gt;&#13;&#10; &lt;/tr&gt;&#13;&#10; &lt;tr height=68 style='height:51.0pt'&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none' x:num=&quot;196&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl30 width=175 style='border-top:none;border-left:none;width:131pt'&gt;The&#13;&#10;  Maze&lt;/td&gt;&#13;&#10;  &lt;td class=xl38 style='border-top:none;border-left:none' x:num=&quot;36940&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none' x:num=&quot;98&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none none;mso-ignore:style;color:green'&#13;&#10;  x:num=&quot;1&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none' x:num=&quot;35&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none' x:num=&quot;3050&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none' x:num=&quot;1600&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none' x:num=&quot;1450&quot;&#13;&#10;  x:fmla=&quot;=G202-H202&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&#13;&#10;  x:num=&quot;41.428571428571431&quot; x:fmla=&quot;=I202/F202&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl30 width=1586 style='border-top:none;border-left:none;width:1190pt'&gt;Collin&#13;&#10;  ran the Nauticat and dove w/us-- Nigel assisted up topside. Planned profile&#13;&#10;  was 100' for 15min, 60' for 10min. (I took a sudafed and an ibuprofen prior&#13;&#10;  to the dive)&lt;br&gt;&#13;&#10;  Swam figure eights at depth in big/deep coral formations; quite cool.&lt;span&#13;&#10;  style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Upon coming up from the wall to our&#13;&#10;  shallower part of the profile Trina saw a black eel (I didn't).&lt;span&#13;&#10;  style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;We spent ample time up on the reef and&#13;&#10;  were joined by several Carribean reef sharks, again joining us quite&#13;&#10;  leisurely and swimming quite close and inquisitively.&lt;span&#13;&#10;  style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;I followed each of them until we lost them&#13;&#10;  in the blue-- and counted 5 separate encounters, 2 in a pair, one alone, and&#13;&#10;  then again another pair (though it may have been the same pair).&lt;span&#13;&#10;  style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;During our safety stop we watched a remora&#13;&#10;  (black and yellow) 'cleaning' the tank of one of our fellow divers.&lt;span&#13;&#10;  style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Eventually he came over toward me-- quite&#13;&#10;  a cute little guy.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;Made me think of&#13;&#10;  Duke swimming at me, maintaining eye contact and quite playful.&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;Trina Seinfeld&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;NAUI&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none' x:num=&quot;85&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none' x:num=&quot;78&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;shorty, booties&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none' x:num=&quot;8&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;good&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none' x:num=&quot;70&quot;& -left:none' x:num=&quot;2000&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none' x:num=&quot;500&quot;&#13;&#10;  x:fmla=&quot;=G206-H206&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&#13;&#10;  x:num=&quot;16.129032258064516&quot; x:fmla=&quot;=I206/F206&quot;&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl30 width=1586 style='border-top:none;border-left:none;width:1190pt'&gt;Did&#13;&#10;  my first 'interpretive' talk today.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;I&#13;&#10;  let Craig get in first, and spent time speaking with the kids telling them a&#13;&#10;  diver would be in their shortly, what we were feeding, which fish liked which&#13;&#10;  food that the tank was ~20k gal, that currently there were about 70 fish in&#13;&#10;  there, about 40 species, etc.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;They&#13;&#10;  were quite fixated on the sharks and questions about them :-).&lt;span&#13;&#10;  style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;I then joined Craig, and fed my&#13;&#10;  bucket.&lt;span style=&quot;mso-spacerun: yes&quot;&gt;&nbsp; &lt;/span&gt;We straightened a bit and&#13;&#10;  then we got out as given the change in routine we and Alan forgot to do a&#13;&#10;  briefing on what we should be cleaning/focusing on today.&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;Craig Rees&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;NAUI&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-left:none'&gt;&lt;/td&gt;&#13;&#10;  &lt;td class=xl29 style='border-top:none;border-l
